import React from "react";

export default function Footer() {
  return (
    <footer className="bg-light text-center text-muted py-3 mt-auto">
      <div className="container">
        <p className="mb-0">&copy; 2024 EventHub. All rights reserved.</p>
      </div>
    </footer>
  );
}
